import { ChangeKeyMap } from "./types";

export const changeKeyMap: ChangeKeyMap = {
  default: { obj: "mediaJSON", key: "default" },
  over: { obj: "mediaJSON", key: "over" },
  overSound: { obj: "mediaJSON", key: "overSound" },
};
